//import React from "react";
import React, { useState, useEffect, useRef } from "react";

import {
  Grid,
  Box,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  Card,
  CardActions,
  CardContent,
  CardActionArea,
  CardMedia,
  Link
} from "@material-ui/core";
import { Star as StarIcon } from "@material-ui/icons";
import { yellow } from "@material-ui/core/colors/index";
import useStyles from "./styles";

//components
import { Typography, Chip } from "../../components/Wrappers";

import img from "../../images/img1.jpg";


//products array
import { rows } from "./mock";
import axios from "axios";

const Hardware = props => {
  const typeRef = React.useRef(null);
  const brandsRef = React.useRef(null);
  const sizeRef = React.useRef(null);
  const colourRef = React.useRef(null);
  const rangeRef = React.useRef(null);
  const sortRef = React.useRef(null);

  const ws = useRef(null);

  const rows2 = [];

  const classes = useStyles();


  useEffect(() => {
        ws.current = new WebSocket("ws://79.143.25.41:8080/gear");
        ws.current.binaryType = 'arraybuffer';
        ws.current.onopen = () => {
          console.log("ws opened");
          axios.defaults.headers.common["Authorization"] = "";
          axios.get("/hardware/?owner="+localStorage.getItem("user")).then(res => { console.log(res.data); 
            var len = res.data.length;
            for (var i = 0; i < len; i++) {
               //rows2[i] = {res.data.device, "offline"};
               console.log(res.data[i].dev_sn);
               rows2[i] = {"dev_sn":res.data[i].dev_sn, "stat":"offline"};
//               rows2[i]res.data[i].dev_sn] = "offline";

            }
            console.log(rows2);

            ws.current.send(JSON.stringify(res.data));}).catch(err => console.error(err));
//          ws.current.send("hi");
        }
        ws.current.onclose = () => console.log("ws closed"); //devs - offline

        return () => {
            ws.current.close();
        };
    }, []);

    useEffect(() => {
        if (!ws.current) return;
        ws.current.onmessage = e =>  {
//          console.log(e.data);
            if(e.data != null) {
            var obj = JSON.parse(e.data);
           console.log(obj.device, obj.online);
//           if(obj.online === "true") { rows2[obj.device] = "online";}
//           if(obj.online === "false") { rows2[obj.device] = "offline";}
  //         console.log(rows2);
        }
     };
    }, []);


          //ws.current.send("hi");

  return (
    <>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Box display="flex">
          </Box>
        </Grid>
        <Grid item xs={12}>
          <Box display={"flex"} flexWrap={"wrap"}>
            <Grid container item spacing={3}>
{rows2.map(c => (
                <Grid item xs={12} md={3} key={c.id}>
                  <Card className={classes.card}>
                    <CardActionArea component={Link} href={`/#`}>


                      <CardMedia
                        className={classes.media}
                        image={img}
                        title={rows2.dev_sn}
                      >
                      </CardMedia>
                      <CardContent>
                        <Typography gutterBottom variant="h5" component="h2">
                          {c.title}
                        </Typography>
                        <Typography
                          variant="body2"
                          color="text"
                          colorBrightness={"secondary"}
                          component="p"
                        >
                          {rows2.stat}
                        </Typography>
                      </CardContent>
</CardActionArea>
                    <CardActions style={{ padding: 16 }}>
                      <Box
                        display={"flex"}
                        justifyContent={"space-between"}
                        alignItems="center"
                        width={"100%"}
                      >
                        <Typography weight={"bold"}>id{c.price}</Typography>
                        <Typography block>
                          <div style={{ color: yellow[700] }}>
                            {rows[0].rating}
                            <StarIcon
                              style={{ color: yellow[700], marginTop: -5 }}
                            />
                          </div>
                        </Typography>
                      </Box>
                    </CardActions>
                  </Card>
                </Grid>
              ))}

            </Grid>
          </Box>
        </Grid>
      </Grid>
    </>
  );
};

export default Hardware;
